import React from 'react';
import styled from 'styled-components';  
import  StyledTopImage from '../styles/StyledTopImage';


const TopImage = ({ image, title, text }) => (
    <StyledTopImage image={image}>
        <div classname="heroimage-content">
            <div classname="heroimage-text">
                <h1>{title}</h1>
                <p>{text}</p>
            </div>
        </div>
    </StyledTopImage>
);

// Exporting the element so you can import it in other places
export default TopImage;
